// transfers my html ids and brings them over to js so that it can be used here
var Mdate = document.getElementById("Mdate");    
var searchB = document.getElementById("searchB");
var infoS = document.getElementById("infoS");

// whenever my button, searchB, is clicked, the following happens
searchB.addEventListener("click", function(){
    
    // the if statements below will activate corresponding to the select tag's shown date. For example, if the option "1981-1989" is shown, an image of Mario and the game he was in would be shown along with some text giving background info, games made that year, and the importance of those years
    if (Mdate.value === "1981-1989")
        infoS.innerHTML = "<img src='https://vignette.wikia.nocookie.net/fantendo/images/0/09/Jumpman_and_pauline_and_donkey_kong.jpeg/revision/latest/scale-to-width-down/180?cb=20090215190805' height='500' width='800'> <br>  Mario comes from the game Donkey Kong and was first called Jumpman. Jumpman was a carpenter and had a pet ape named Donkey Kong. Because DK was mistreated, he ran away and kidnapped Jumpman's mistress, formerly known as the Lady. The first game of Mario was an arcade game. Jumpman was renamed Mario in 1982. Super Mario Bros came after Mario Bros and involved the story line we have every Mario game, Princess Peach being kidnapped by Bowser. Super Mario Bros 2 has 3 playable characters each having their own unique abilities. The 3 characters were Luigi, Peach, and Toad. In Super Marios 3, Mario tries to save the rulers from Bowser by going to each of the 7 kingdoms.";

    if (Mdate.value === "1988-1994")
        infoS.innerHTML = "<img src='https://cdn.vox-cdn.com/uploads/chorus_asset/file/3823612/maxresdefault.jpg' height='500' width='800'> <br>  Super Mario Land involves Princess Daisy being captured by an alien. Mario corners the alien and takes down his ship and rescueing Daisy. In Super Mario World, Mario and Luigi take Princess Peach to Dinosaur Land where she's captured again. Using the Yoshis, dinosaurs that live on that island, Mario and Luigi save Princess Peach.  In Super Mario Land 2, Wario, Mario's evil counterpart, puts a spell over Mario's kingdom and brainwashes them to believe Mario is their enemy and Wario is their ruler. Mario takes his kingdom back by gathering 6 coins and returning to his kongdom. In Super Mario World 2: Yoshi's Island, baby luigi gets kidnapped, and Baby Mario, along with Yoshi, save Baby Luigi.";
        
    if (Mdate.value === "1991-1993")
        infoS.innerHTML = "<img src='data:image/jpeg;base64,' height='500' width='800'>   <br>     In this era, Mario gains superpowers. His colors also improved and leads the Mario franchise to its highest peaks. Mario also made his 3D debut in Super Mario 64. Bowser, again, kidnaps Princess Peach withing her castle and Mario has to go through portals, the paintings of Princess Peach's castle, to gather the power stars. In 1991, Mario is in Dinosaur Land and ends up saving Princess Toadstool and does not involve the Mushroom Kingdom. The first Mario racing game, Super Mario Kart, came out in 1992. The game had 3 cups, mushroom, flower, and star.";
        
    if (Mdate.value === "1996-2004")
        infoS.innerHTML = "<img src='data:image/jpeg;base64,'  height='500'width='800'>   <br>   In 1996, Mario became less 2D and had more shape. The game, Super Mario RPG broke the 2D world and changed from the typical side-scroller. Super Mario RPG had the biggest storyling at that time.Mario continues to travel through the 3D reality and had more easter eggs in its gameplay. Super Mario Sunshine was another major game released in this time. The plot involves Mario, Toad, and Princess Peach on vacation in Isle Delfino. Shadow Mario starts polluting the city with his paintbrush and the citizens think that it's actually Mario polluting the city. Mario has to prove that he's innocent by defeating Shadow Mario using he FLUDD technology, a machine that absorbed and sprayed water at high pressures."; 
        
    if (Mdate.value === "2006-2018")
        infoS.innerHTML = "<img src='data:image/jpeg;base64,' height='400' width='500'> <img src='https://images-na.ssl-images-amazon.com/images/I/61Evlt3wq8L._SY445_.jpg' height='400' width='500'>  <br>   From 2006 to 2018, Mario received many games such as New Super Mario Bros, SUper Mario Galaxy, Super Mario Galaxy 2, the Paper Mario franchise, etc. The Super Mario Galaxy series involves Bowser throwing Princess Peach's castle into space. Mario has to go to space and meets Rosalina, known as the mother of the Lunas and Guardian of the Cosmos. Mario also meets the Lunas. The Paper Mario franchise involves Mario being able to go through different dimensions. Players solve puzzles by looking at the different spatial dimensions. One of the latest Mario games, Mario Odyssey was the first 3D Mario game since 2011. The plot still includes Peach getting kidnapped and Bowser attmpting to marry her.";
});

// the following will happen depending on the option chosen after the button is clicked
searchB.addEventListener("click", function(){
    
    // changes the color to orangered if the option, 1981-1989, is chosen
    if(Mdate.value === "1981-1989")
        document.body.style.backgroundColor = "orangered";
        
    // changes the color to orange if the option, 1988-1994, is chosen
    if(Mdate.value === "1988-1994")
        document.body.style.backgroundColor = "#eea22e";
    
    // changes the color to darkish pink if the option, 1991-1993, is chosen
    if(Mdate.value === "1991-1993")
        document.body.style.backgroundColor = "darksalmon";
        
    // changes the color to purple pink if the option, 1996-2004, is chosen   
    if(Mdate.value === "1996-2004")
        document.body.style.backgroundColor = "orchid";
        
    // changes the color to skyish blue if the option, 2006-2018, is chosen    
    if(Mdate.value === "2006-2018")
        document.body.style.backgroundColor = "#25C4F9";
})
